import React from "react";

//Components
import Page from "../components/page";
import PageTitle from '../components/pagetitle';

const Home = () => {
  return (
    <Page>
      <PageTitle
        headline="Front-end Developer and UX Designer"
        url="/contact"
        action="Let's connect"
      />
    </Page>
  );
};

export default Home;
